@stefan nica - tu nu esti suficient de inteligent sa-ti aduni toate ideile intr-o singura postare...
 Cred ca productia de brichete e buna, singurul importator/exportator fiind FC Rapid Bucuresti, care isi trimite in dese rinduri oamenii in delegatie in Italia, Spania sau Germania.
 
 dar ai si dreptate, crucea pe tricou e o mizerie marca "ciobanul".
